import PostDiv from "../components/PostDiv";

function Profile({webBrowserHeight}){
    return (
        <div className="Profile"  style={{ height: `${webBrowserHeight}px` }}>
            <div>
                프로필 영역
            </div>
            <PostDiv data={null} />
        </div>
    );
}

export default Profile;
